import React, { Component } from 'react';
import {Form, Button, FormControl} from 'react-bootstrap'
import './comp.css'
class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      data: null,
    };
  }
  // componentDidMount() {
  //   fetch(`https://www.googleapis.com/books/v1/volumes?q=${this.state.data}:keyes&key=AIzaSyAaCiGPlCZcM6BcH4laKHqE0OWezL-us7g`)
  //     .then(response => response.json())
  //     .then(data => this.setState({ data }));
  // }

  srchFunc = (e) => {
    const searchh = e.target.elements.srchBar.value
      e.preventDefault()
      fetch(`https://www.googleapis.com/books/v1/volumes?q=${searchh}:keyes&key=AIzaSyAaCiGPlCZcM6BcH4laKHqE0OWezL-us7g`)
        .then(response => response.json())
        .then(data => this.setState({ data }));
    }
  render(){
    return(
      <>
      <br/>
      Test
      <div className="searchBAR">
  <form onSubmit={this.srchFunc}>
    <FormControl type="text" name="srchBar" placeholder="Search" className=" mr-sm-4" />
    <Button type="submit">Submit</Button>
    </form>
    </div>
      {/* {
        console.log(this.state.data)
      } */}
      { this.state.data.map(book => 
          <div className="card border-secondary col-4" style={{"max-width": "18rem;"}}><img src={book.items}/></div>)}


           { this.state.data.map(book => 
            <div className="card-header"><h5 className="card-title">{book.items.title}</h5></div>)}

      { this.state.data.map(book => <div className="card-body text-secondary"><p className="card-text">{book.items}</p></div>)}
      </>
    )
  }
}
export default App;
